import React, { useState, useEffect } from 'react';
import styles from './Navbar.scss';
import Box from '@mui/material/Box';
import { Flag } from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';




const Navbar = () => {
    // getlocalss
    const [userId, setUserId] = useState(false);
    const navigate = useNavigate()

    const logout = () => {
        // localStorage.setItem('userId', '')
        console.log('>>>> logout', logout)
        setTimeout(() => {
            setUserId(false)
            navigateTo('/')
        }, 300);
      };


    useEffect(() => {
        setUserId(localStorage.getItem('userId'));
        console.log('userId>>>>', userId)
      });


      const navigateTo = async (part) => {
        if (part) {
          await navigate(part)
          window.location.reload()
        }
      }

  return (
    <nav className={styles.navbar}>
            {!userId ? (
                <div>
                <a class="btn btn-sm btn-outline-secondary" href="/login">Sign In</a> <br></br>
                <a class="btn btn-sm btn-success" href="/register">Sign Up</a> <br></br>
                <a class="btn btn-sm btn-home" href="/">Home</a> 

                </div>
        ) : (
            <a className="btn btn-sm btn-outline-secondary" onClick={logout()} href="">Sign Out</a>
        )}
    </nav>

  );
};

export default Navbar;
